import { Routes } from "react-router-dom";
import "./App.css";
import LoginForm from "./loginForm/LoginForm";
import MyPosts from "./myPosts/MyPosts";
import RegisterForm from "./registerForm/RegisterForm";

function App() {
  return (
    <>
      <Routes>
        <Route path='/login' element={<LoginForm />}/>
        <RegisterForm />
        <MyPosts />
      </Routes>
    </>
  );
}

export default App;
